import React from 'react';
import './App.css';
import Dashboard from './dashboard/Dashboard.jsx';
import Login from './login/Login.jsx';
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <div className="bg-red-100 h-screen">
      <React.Fragment>
        <Routes>
          <Route path="/"></Route>
        </Routes>
      </React.Fragment>
      <Login/>
      <Dashboard/>
    </div>
  );
}

export default App;
